            if(response.status === 200) {
                const jsonOBJ = JSON.parse(stringifySafe(response.data));
                setItemList(  jsonOBJ["photo"]);
            }else{
                setItemList({});
            }

        }

        fetchData();

    },[itemlist])


    return (<div>
        {<Elements producto={id} />}
    </div>);
}
